import React from 'react';

const Koompi = () => {
    return (
        <div className="section2Banner">
            <div className="ui container">
                <h1 className="section2Title">KOOMPI KOSMOS</h1>
                <p>KOSMOS is the default OS for KOOMPI Laptop and its future devices.</p>
                <a href="https://koompi.com/" target="_blank" rel="noopener noreferrer"><h5>Learn More <i className="angle right icon iconSection2"></i></h5></a></div>
        </div>
    );
}

export default Koompi;
